How to get the data from 2 different collections using lookup and how to add some condition in lookup to get the data based on some condition?<p>I have two collections as shown below:</p>
<p>First collection:</p>
<pre class="lang-json prettyprint-override"><code>[{
    &quot;UID&quot; : 3398,
    &quot;name&quot; : &quot;test&quot;
}]
</code></pre>
<p>Second collection:</p>
<pre class="lang-json prettyprint-override"><code>[{
    &quot;ques_id&quot; : &quot;q1&quot;,
    &quot;ri_score&quot; : 5.3,
    &quot;uc_id&quot; : 3398
},
{
    &quot;ques_id&quot; : &quot;q2&quot;,
    &quot;ri_score&quot; : 5.3,
    &quot;uc_id&quot; : 3398
}]
</code></pre>
<p>The query which I am using is given below:</p>
<pre class="lang-js prettyprint-override"><code>db.first_collection.aggregate([
  {
    $lookup: {
      from: &quot;second_collection&quot;,
      localField: &quot;UID&quot;,
      foreignField: &quot;uc_id&quot;,
      as: &quot;second_collection_docs&quot;
    }
  },
  {
    $project: {
      &quot;UID&quot;: 1,
      &quot;name&quot;: 1,
      &quot;second_collection_docs.ri_score&quot;: 1
    }
  }
])
</code></pre>
<p>The above query returns the data as shown below:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;UID&quot; : 3394,
    &quot;name&quot; : &quot;test&quot;,
    &quot;second_collection_docs&quot; : [{
            &quot;ri_score&quot; : &quot;5.3&quot;
        }, 
        {
            &quot;ri_score&quot; : &quot;5.3&quot;
        }]
}
</code></pre>
<p>In the second collection data it is giving the same ri_score 2 times but I want it only one time. The expected result is shown below:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;UID&quot; : 3394,
    &quot;name&quot; : &quot;test&quot;,
    &quot;second_collection_docs&quot; : [{
            &quot;ri_score&quot; : &quot;5.3&quot;
        }]
}
</code></pre>
<p>Is there any solution for this so that I can get the expected result? Thank you in advance.</p>

