How to define ObjectId in DTO & what is the right query to get relational data in NestJS Mongoose?<p>I'm setting up an app using NestJS, Angular, GraphQL and MongoDB and new to these stacks
I have 2 collections called <code>Tasks</code> &amp; <code>Statuses</code> with sample data</p>
<p>Tasks</p>
<pre><code>[{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;5f9138f71163a739c43fc9b3&quot;
  },
  &quot;TaskDesc&quot;: &quot;Meeting with Brian&quot;,
  &quot;StartedDate&quot;: &quot;2020-10-22T07:42:40Z&quot;,
  &quot;EndDate&quot;: &quot;2020-10-22T10:42:40Z&quot;,
  &quot;StatusId&quot;: &quot;5f91375d1163a739c43fc9af&quot;
}]
</code></pre>
<p>Statuses</p>
<pre><code>[{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;5f91375d1163a739c43fc9af&quot;
  },
  &quot;StatusDesc&quot;: &quot;Done&quot;
}]

</code></pre>
<p>Here are schemas defined in NestJS</p>
<pre><code>import { Schema, Types } from 'mongoose';
import { MongooseModule } from '@nestjs/mongoose';

export const TaskSchema = new Schema({
    TaskDesc: String,
    StartedDate: String,
    EndDate: String,
    StatusId:  
    {
        type: Types.ObjectId, 
        ref: 'Statuses'
    }
});

export const StatusSchema = new Schema({
    StatusDesc: String
});

export const SchemaGroups = MongooseModule.forFeature([
    {name: 'Tasks', schema: TaskSchema, collection: 'Tasks'},
    {name: 'Statuses', schema: StatusSchema, collection: 'Statuses'}
]);

</code></pre>
<p>The DTO</p>
<pre><code>import { ObjectType, Field, ID } from '@nestjs/graphql';

@ObjectType()
export class TasksDTO {
  @Field(() =&gt; ID)
  id?: string;
  @Field()
  TaskDesc: string;
  @Field()
  StartedDate: string;
  @Field()
  EndDate: string;
  @Field()
  StatusId: string;
}

@ObjectType()
export class StatusDTO {
  @Field(() =&gt; ID)
  readonly id?: string;
  @Field()
  readonly StatusDesc: string;
}

</code></pre>
<p>The model</p>
<pre><code>import { Document, Schema } from 'mongoose';
export interface Tasks extends Document {
    readonly TaskDesc : string,
    readonly StartedDate: string,
    readonly EndDate: string,
    readonly StatusId: Schema.Types.ObjectId
}
export interface Status extends Document {
    readonly StatusDesc : string
}
</code></pre>
<p>The resolver</p>
<pre><code>@Resolver('Tasks')
export class ListTodoResolver {
    constructor(private readonly todoItemsService: TodolistService){

    }

    @Query(() =&gt; [TasksDTO])
    async Tasks(): Promise&lt;TasksDTO[]&gt; {
      return await this.todoItemsService.getAllTasks();
    }

    @Query(() =&gt; [StatusDTO])
    async Statuses(): Promise&lt;StatusDTO[]&gt;{
      return await this.todoItemsService.getAllStatuses();
    }
}
</code></pre>
<p>The service</p>
<pre><code>import { Injectable } from '@nestjs/common';
import { InjectModel } from '@nestjs/mongoose';
import { Model } from 'mongoose';
@Injectable()
export class TodolistService {
    constructor(
        @InjectModel('Tasks') private readonly todoItemsModel: Model&lt;Tasks&gt;,
        @InjectModel('Statuses') private readonly statusItemsModel: Model&lt;Status&gt;
    ) { }

    async getAllTasks() : Promise&lt;Tasks[]&gt;{
        let tasks = await this.todoItemsModel.find().exec(); // how should we query in the service to get relational data from another collection?
        console.log(tasks);

        return tasks;
    }

    async getAllStatuses() : Promise&lt;Status[]&gt;{
        return await this.statusItemsModel.find().exec();
    }
}
</code></pre>
<p>And I had these errors
<code>Type 'Tasks' is not assignable to type 'TasksDTO'. Types of property 'StatusId' are incompatible. Type 'ObjectId' is not assignable to type 'string'.</code></p>
<p>How do we define the ObjectId type in the DTO ?
My expected output for <code>getAllTasks()</code> method would be</p>
<pre><code>[{
  &quot;_id&quot;: &quot;5f9138f71163a739c43fc9b3&quot;,
  &quot;TaskDesc&quot;: &quot;Meeting with Brian&quot;,
  &quot;StartedDate&quot;: &quot;2020-10-22T07:42:40Z&quot;,
  &quot;EndDate&quot;: &quot;2020-10-22T10:42:40Z&quot;,
  &quot;StatusDesc&quot;: &quot;Done&quot;
}]
</code></pre>

