<p>I have an ExpressJS server which is used to provide API requests to retrieve data from a MongoDB database. I am using mongoosejs for the MongoDB connection to query/save data.</p>
<p>I am building a route that will allow me to find all data that matches some user input but I am having trouble when doing the query. I have spent a long while looking online for someone with a similar issue but coming up blank.</p>
<p>I will leave example of the code I have at the minute below.</p>
<p><strong>code for route</strong></p>
<pre><code>// -- return matched data (GET)
router.get('/match', async (req, res) =&gt; {

    const style_data = req.query.style; // grab url param for style scores ** this comes in as a string **
    const character_data = req.query.character; // grab url param for character scores ** this comes in as a string **

    // run matcher systems
    const style_matches = style_match(style_data);

    res.send({
        response: 200,
        data: style_matches
    }); // return data

});
</code></pre>
<p><strong>code for the query</strong></p>
<pre><code>// ---(Build the finder)
const fetch_matches_using = async function(body, richness, smoke, sweetness) {
    return await WhiskyModel.find({
        'attributes.body': body,
        'attributes.richness': richness,
        'attributes.smoke': smoke,
        'attributes.sweetness': sweetness
    });
}

// ---(Start match function)---

const style_match = async function (scores_as_string) {

    // ---(extract data)---
    const body = scores_as_string[0];
    const richness = scores_as_string[1];
    const smoke = scores_as_string[2];
    const sweetness = scores_as_string[3];

    const matched = [];

    // ---(initialise variables)---
    let match_count = matched.length;

    let first_run; // -&gt; exact matches
    let second_run; // -&gt; +- 1
    let third_run; // -&gt; +- 2
    let fourth_run; // -&gt; +- 3

    // ---(begin db find loop)---

    first_run = fetch_matches_using(body, richness, smoke, sweetness).then((result) =&gt; {return result});

    matched.push(first_run);

    // ---(return final data)---

    return matched

}
</code></pre>
