<p>if I console.log() the result from within the .then() I get an empty array.</p>
<p>I have tried using the populate() method after running the find which does technically work, but instead of only returning data that matches it returns every entry in the collection so I think I am doing something wrong there, but I also don't see why I would need to use the .populate() function to access the nested object.</p>
<p>Am I doing something totally wrong here?</p>
<p>I should also mention that the route and the matching functions are in different files just to try and keep things simple.</p>
